const Part =(part)=>{
  console.log(part.name)
  return(
    <div>
      <p>{part.name} {part.exercises}</p>
    </div>
  )
}

const Header =(head)=>{
  return(
    <div>
      <h1>{head.course}</h1>
    </div>
  )
}

const Content =(items)=>{
  return(
    <div>
      <Part name={items.names[0]} exercises={items.exercises[0]}/>
      <Part name={items.names[1]} exercises={items.exercises[1]}/>
      <Part name={items.names[2]} exercises={items.exercises[2]}/>
    </div>
  )
}

const Total =(total)=>{
  return(
    <div>
        <p>
          Number of exercises {total.exercises[0] + total.exercises[1] +total.exercises[2]}
        </p>
    </div>
  )
}

const App =()=> {
  const course = "Half Stack application development"
  const names = ["Fundamentals of React","Using props to pass data","State of a component"]
  const exercises = [10,7,14]

  return (
    <>
      <Header course={course}/>
      <Content names={names} exercises={exercises} />
      <Total exercises={exercises} />
    </>
  );
}

export default App
